import axios from "axios";

export const userLogin = async (email, password) => {
    console.log(email, password)
    // const response = await axios.post('/users/login', {
    //     email,
    //     password
    // }).then(res => {
    //     console.log(res)
    // }).catch(e => {
    //     console.log(e)
    // })
    const response = await axios({
        method: 'post',
        url: '/users/login',
        data: {
            email,
            password
        }
    });
    return response
}
